import React from 'react';

export default function Resume() {
  return (
    <div>
      <h2>Resume</h2>
      <p>
        You can check my Resume on my linkedin.
      </p>
      <a href="https://www.linkedin.com/in/greg-chambers-880140237/" >linkedin</a>
      <footer><a href="https://github.com/Gcoder9" >Github</a></footer>
    </div>

  );

}
